import React from 'react';
import '../../css/Logbook.css';
import { Redirect } from 'react-router-dom';
import { withRouter } from 'react-router';
import { Link } from 'react-router-dom';

class Logbook extends React.Component {
    constructor() {
        super();

        this.state = {
            logbooks: [],
            isEmptyLogbook: false
        }
        this.showTableRows = this.showTableRows.bind(this);
    }

    componentDidMount() {
        let jwtToken = localStorage.getItem("JwtToken");

        fetch(`/get/logbook/${jwtToken}`, {
            method: 'GET',
            headers: {
                'Accept': 'application/json, text/plain, */*',
                'content-type': 'application/json'
            }
        }).then(response => response.json())
        .then(jsonData => {
            console.log(jsonData);
        });
    }

    showTableRows() {
        if(this.state.logbooks.length === 0) {
            this.setState({ isEmptyLogbook: true });
        } else {
            if(this.state.isEmptyLogbook === true) {
                this.setState({ isEmptyLogbook: false });
            }
            let rowNumber = 0;
            return this.state.logbooks.map((logbook, index) => {
                return (
                    <tr key={index}>
                        <th scope="row">{++rowNumber}</th>
                        <td>{logbook.partnerName}</td>
                        <td>{logbook.partnerSurname}</td>
                        <td>{logbook.entryTime}</td>
                        <td>{logbook.exitTime}</td>
                        <td>{logbook.marker.name}</td>
                        <td>{logbook.averageDepth}</td>
                        <td>{logbook.maxDepth}</td>
                        <td>{logbook.airTemperature}</td>
                        <td>{logbook.waterTemperature}</td>
                        <td>{logbook.divingType}</td>
                        <td>
                            <button className="btn btn-primary">
                                PDF
                            </button>
                        </td>
                        <td>
                            <button className="btn btn-danger">
                                DELETE
                            </button>
                        </td>
                    </tr>
                );
            })
        }
    }

    showTable() {
        return (
            <div className="table-center table-margin">
                <div className="table-responsive">
                    <table className="table table-hover table-striped">
                        <thead>
                            <tr className="table-success">
                                <th scope="col">#</th>
                                <td>Partner's name</td>
                                <td>Partner's surname</td>
                                <td>Entry time</td>
                                <td>Exit time</td>
                                <td>Location</td>
                                <td>Average depth</td>
                                <td>Maximum depth</td>
                                <td>Air temperature</td>
                                <td>Water temperature</td>
                                <td>Diving type</td>
                                <td>PDF</td>
                                <td>DELETE</td>
                            </tr>
                        </thead>
                        <tbody>
                            { this.showTableRows() }
                        </tbody>
                    </table>
                </div>
            </div>
        );
    }

    render() {
        let isEmptyLogbook = this.state.isEmptyLogbook;

        return (
            <div className="logbook-container">
                <div className="logbook-center">
                    <Link to="/add/dive">
                        <div className="btn btn-primary btn-logbook-margin">
                            Add dive to logbook
                        </div>
                    </Link>
                </div>
                { isEmptyLogbook && this.showTable() }        
                <NoLogbookData isEmptyLogbook={this.state.isEmptyLogbook} />
            </div>
        );
    }
}

function NoLogbookData(props) {
    if(!props.isEmptyLogbook) {
        return (
            <div className="no-data-center">
                <div className="alert alert-danger no-data-margin no-data">
                    No data in your logbook.
                </div>
            </div>
        );
    }
    return null;
}

export default withRouter(Logbook);
